/*
   滑动窗口的概念:两个指针,第二个指针向右走,碰到不符合规则的地方(此要求中是无重复的),就把左边的指针移动到重复的地方
*/

class Solution {
public:
    int lengthOfLongestSubstring(string s) {
		int i = 0;
		int ans = 0, rk = 0;
		//第一个位置存放字符,第二个存放地址
		//map<char, int> occ;
		unordered_set<char> occ;
		int n = s.size();
		//while(i<n)
		for(i=0;i<n;++i)
		{
			if(i != 0)
			{
				occ.erase(s[i-1]);
			}
			while(rk<n && !occ.count(s[rk]))
			{
				occ.insert(s[rk]);
				++rk;
			}
			ans = max(ans, rk - i);
			//这里每次都是移动到下一个无重复的位置,所以不用查询
			//while(rk<n && !occ.count(s[rk]))
			//{
			//	occ[s[rk]] = rk;
			//	++rk;
			//}
			////先计算最长的字符串长度
			//ans = max(ans, rk-i);
			////rk这个字符重复了,把i移动到s[rk]的value位置
			//occ.erase(occ.begin(), ++occ.find(s[i]));
			////i = occ[s[i]] + 1;
			//i = rk;
			//occ.clear();
			//cout << "occ.size() = " << occ.size() << endl;
			//cout << "i = " << i << " rk = " << rk << endl;
		}
		return ans;
    }
};

